import React from 'react'
import {List, Header} from "semantic-ui-react";

const Quizzes = ({ quizzes }) => {

    return (
        <List>
            {quizzes.map(quiz => {
            return(

                <List.Item key={quiz.quiz_id}>
                    <Header>{quiz.quiz_id}</Header>
                </List.Item>
                )

            })}
        </List>
    )
}

export default Quizzes
